import "./App.css";
import { BrowserRouter, Route, Routes } from "react-router-dom";
import Dashboard from "./pages/dashboard/dashboard";
import Home from "./pages/home/home";

function App() {
  return (
    <BrowserRouter>
      <Route path="/home" element={<Home />} />
      <Routes>
        <Route
          path="/"
          element={
            <div className="App">
              <Dashboard />
            </div>
          }
        />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
